import { Route, Routes } from "react-router-dom";
import VideoPlayer from "./VideoPlayer";
<h2>RẠP CHIẾU PHIM</h2>
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Routes>
          <Route path="/" element={<VideoPlayer />}></Route>
        </Routes>
      </header>
    </div>
  );
}
export default App;
